import * as React from 'react';
import classNames from 'classnames';

export default class LoginForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            active: "login",
            firstName: "",
            lastName: "",
            login: "",
            password: "",
            isLoggedIn: false, // New state variable
            message: "" // Message to display after login
        };
    }

    onChangeHandler = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        this.setState({ [name]: value });
    };

    onSubmitLogin = (e) => {
        e.preventDefault(); // Prevent default form submission
        const { login, password } = this.state;
        this.props.onLogin(e, login, password).then((response) => {
            if (response.success) { // Assuming response has a success flag
                this.setState({ 
                    isLoggedIn: true,
                    message: "Login successful! You can now register."
                });
            } else {
                this.setState({ message: "Login failed. Please try again." });
            }
        });
    };

    onSubmitRegister = (e) => {
        e.preventDefault(); // Prevent default form submission
        this.props.onRegister(e, this.state.firstName, this.state.lastName, this.state.login, this.state.password);
    };

    render() {
        const { isLoggedIn, message, active } = this.state;

        return (
            <div className="row justify-content-center">
                <div className="col-4">
                    {isLoggedIn && <div className="alert alert-success">{message}</div>}

                    <ul className="nav nav-pills nav-justified mb-3" id="ex1" role="tablist">
                        <li className="nav-item" role="presentation">
                            <button
                                className={classNames("nav-link", active === "login" ? "active" : "")}
                                id="tab-login"
                                onClick={() => this.setState({ active: "login" })}
                            >
                                Login
                            </button>
                        </li>
                        <li className="nav-item" role="presentation">
                            <button
                                className={classNames("nav-link", active === "register" ? "active" : "")}
                                id="tab-register"
                                onClick={() => this.setState({ active: "register" })}
                            >
                                Register
                            </button>
                        </li>
                    </ul>

                    <div className="tab-content">
                        <div className={classNames("tab-pane", "fade", active === "login" ? "show active" : "")} id="pills-login">
                            <form onSubmit={this.onSubmitLogin}>
                                <div className="form-outline mb-4">
                                    <input type="text" id="loginName" name="login" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="loginName">Username</label>
                                </div>

                                <div className="form-outline mb-4">
                                    <input type="password" id="loginPassword" name="password" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="loginPassword">Password</label>
                                </div>

                                <button type="submit" className="btn btn-primary btn-block mb-4">Sign in</button>
                            </form>
                        </div>
                        <div className={classNames("tab-pane", "fade", active === "register" ? "show active" : "")} id="pills-register">
                            <form onSubmit={this.onSubmitRegister}>
                                <div className="form-outline mb-4">
                                    <input type="text" id="firstName" name="firstName" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="firstName">First name</label>
                                </div>

                                <div className="form-outline mb-4">
                                    <input type="text" id="lastName" name="lastName" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="lastName">Last name</label>
                                </div>

                                <div className="form-outline mb-4">
                                    <input type="text" id="login" name="login" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="login">Username</label>
                                </div>

                                <div className="form-outline mb-4">
                                    <input type="password" id="registerPassword" name="password" className="form-control" onChange={this.onChangeHandler} />
                                    <label className="form-label" htmlFor="registerPassword">Password</label>
                                </div>

                                <button type="submit" className="btn btn-primary btn-block mb-3">Sign up</button>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
